import { createSlice } from '@reduxjs/toolkit'

let testState = createSlice({
  name: "testState",
  initialState: 0,
  reducers: {
    increase(state, action) {
      return state + action.payload;
    }
  }
})

export let { increase } = testState.actions;
export default testState;
